import React from 'react';
import './css/Interests.css'

function Interests() {
    return (
        <div id="interests-container">
            <h1>Interests</h1>
            <p id='interests-text'>Programmer. Musician. Gamer. Entrepreneur. Public Speaker. Chef. Chess Grand Master. Tech Savy. Problem Solver. Helping Hand.</p>
        </div>
    )
}
export default Interests;
